import React from "react";
import styled from "styled-components";
import BgSvg from "./BgSvg";
import "./Pageone.css";
import Verticalscroll from "./Verticalscroll";

const Container = styled.div`
  display: flex;
  width: 100vw;
  height: 100%;
  z-index: 1;
  background: #1a2238;
`;

const Content = styled.div`
  width: 100vw;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  background: #1a2238;
`;

const Pageone = (props) => {
  const { id, date, img } = props;

  return (
    <Container id="home">
      <BgSvg />
      <Content>
        <div>
          <h1>{id}</h1>
        </div>
        <Verticalscroll id={id} date={date} img={img} />
      </Content>
    </Container>
  );
};

export default Pageone;
